  \"2016-10-16T16:53:57.108647\",\n\t\"name\": \"blackwater-national-wildlife-refuge-narrative-report-september-october-november-and-dece-1-9a443\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Blackwater NWR
  outlines Refuge accomplishments from September through December of 1945. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes Refuge visitors. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
